description:
This is a must download for any Stray Cats fans, it&amp;#039;s a band called The Tom Cats made up of three people you may be familiar with: Brian Setzer, Texas Slim (Lee Rocker), and Slim Jim Phantom.  Before they were The Stray Cats they were The Tom Cats.  Highlights of the album include &quot;Tom Cat Strut.&quot;  There is no track list because this was not listed in the cd database and I didn&amp;#039;t want to go through and name each one before I ripped it.  There&amp;#039;s a bunch of Eddie Cochran covers, some Gene Vincent, and even some Hank Williams covers.

